T-Probe 를 통해 생성된 xDR 데이터와 HDV SIP 와 CDR, WCDMA CDR 데이터 등을 바탕으로 고객경험품질지표(Customer Experience Index)를 집계한 데이터
종합CEI, HDV CEI, Data CEI, CSFB CEI 정보를 제공하며, 각각의 지표를 계산하기 위해 시도호, 소통호, 완료호, 절단호 등 130여개 이상의 측정값을 제공함
지표별 주요 QoE 값으로 음성(HDV, CSFB)은 호처리 단계 경험품질(QoE1), 통화중 음질불량 경험품질(QoE2) 가 제공되며, 데이터(LTE)의 경우에는 Data 서비스 무선 경험품질(QoE1), Data 서비스 CORE 경험품질(QoE2), Data 서비스 3rd Party 경험품질(QoE3)이 제공됨','TMS_01','DC_AGR','DAT_L1','IC_IDP',null,'PC_L50','D_SV05','DS_LV1','PRIV_L4','1000002',null);
